import Product from "./Product"


function Products_(){
    return(
        <div className='products'>
      <Product name="Jeans" price="$500"/>
      <Product name="Kurta" price="$300"/>
      <Product name="Shirt" price="$233 "/>
      </div>
    );
}
export default Products;
